字符串字面量是切片

什么是字符串
Rust 中的字符是 Unicode 类型，因此每个字符占据 4 个字节内存空间，
但是在字符串中不一样，字符串是 UTF-8 编码，也就是字符串中的字符所占的字节数是变化的(1 - 4)
当 Rust 用户提到字符串时，往往指的就是 String 类型和 &str 字符串切片类型，这两个类型都是 UTF-8 编码。

