// trait 方法中生命期的标注基本上与函数类似。注意，impl 也可能有生命周期的标注。
#[derive(Debug)]
struct Borrowed {
    x: &'a i32,
}

// 给 impl 标注生命周期
impl Default for Borrowd {
    fn default() -> Self {
        Self { x: &10}
    }
}


约束

// 就如泛型一样被约束， 生命周期（本质就是泛型）也可以使用约束
// T: 'a : T 中的所有引用都比生命周期‘a 更长
// T: trait + 'a 类型必须实现 Trait trait，并且在 T 中的所有引用 都必须比 'a 活得更长

use std::fmt::Debug; 

#[derive(Dedug)]
struct Ref(&'a T);

fn print(t: T) where 
    T: Debug {
    println!("{:?}", t);        
} 

fn print_ref(t: &'a T) where
    T: Debug + 'a {
      println!("`print_ref`: t is {:?}", t);  
}


